import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import FormControl from 'react-bootstrap/FormControl';
import InputGroup from 'react-bootstrap/InputGroup';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
import  '../components/styles/Footer.css';
import logoPicArg from '../logoPicArg.svg';

const NavigationBar= ()=>{
    return(
        <>
        <Navbar bg="light" expand="lg">

            <Navbar.Brand href="#home">

                <img src={logoPicArg}></img>
                
            </Navbar.Brand>

  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto ">
      <Nav.Link href="#">Fotos</Nav.Link> 
      <Nav.Link href="#">Galerías</Nav.Link>
      <Nav.Link href="#">Fotógrafos</Nav.Link>

    <InputGroup>
        <FormControl className="ancho"/>
            <InputGroup.Append>
                <DropdownButton className="buttonSearch"   as={InputGroup} title="Buscar" id="bg-nested-dropdown" variant="">
                    <Dropdown.Item>Fotos</Dropdown.Item>
                    <Dropdown.Item>Galerías</Dropdown.Item>
                    <Dropdown.Item>Fotógrafos</Dropdown.Item>
                </DropdownButton>
            </InputGroup.Append>
        </InputGroup>
    </Nav>

  </Navbar.Collapse>
</Navbar>
</>
    )
}

export default NavigationBar;
